import React from "react";

const Gallery = ({ photos }) => {
    return (
        <div>
            <h1>Gallery</h1>
            <div className="gallery">
                {photos.map((photo, index) => (
                    <img key={index} src={photo} alt={`Captured ${index}`} width="100" />
                ))}
            </div>
        </div>
    );
};

export default Gallery;
